import Vue from "vue";
import App from "./App.vue";
import router from "./router";
import store from "./store";
import { MotionPlugin } from '@vueuse/motion'

app.use(MotionPlugin)

Vue.config.productionTip = false;

new Vue({
  router,
  store,
  render: (h) => h(App),
}).$mount("#app");
